import React from "react";
import { BrowserRouter } from "react-router-dom";


const App = () => {
  return (
    <>
        < BrowserRouter>
      <h1>Teknolojik Yemekler</h1>
      <p>Burdaki kodu silip kendi headerınızı ekleyebilirsiniz</p>
      </ BrowserRouter>
    </>
  );
};
export default App;
